description:
Victoria Sinclair is a beautiful young athlete with only one desire - to win a gold medal. When she is chosen for her country's swimming team she falls in love with her coach - Adam. There is jealousy from her 9 gorgeous teammates who try to foil Victoria's ambitions, but Victoria wins a gold and the heart of her handsome coach.

